    temp = [0] / N
    Jobs.sort(key=lambda job: job[2], reverse=True)
    for job in Jobs:
        deadline = job[1]
        profit = job[2]
        for j in range(deadline - 1, -1, -1):
            if temp[j] == 0:
                temp[j] = profit
                break
    count = 0
    total_profit = 0
    for profit in temp:
        if profit != 0:
            count += 1
            total_profit += profit
    return [count, total_profit]

